import React from 'react'

const PageIcon = ({imageURL}) => {
     return <div 
          style = { 
               {
                    width: '64px', 
                    height: '64px', 
                    margin: '1vh',
                    backgroundImage: `url(${imageURL})`,
                    backgroundSize: 'cover',
                    backgroundPosition: 'center'
               } 
          }>
               
     </div>
}

export default PageIcon
